entry.value:
// https://mvnrepository.com/artifact/commons-io/commons-io
@Grapes(
        @Grab(group='commons-io', module='commons-io', version='2.5')
)

import java.io.File
import org.apache.commons.io.IOUtils
import java.nio.charset.StandardCharsets

flowFile = session.get()
if (!flowFile) return

String recordSeparator = '--------------------------------------------------\n'
String logPath = customLogPath .evaluateAttributeExpressions().getValue()

File logFile = new File(logPath  as String)
if (logFile.exists() && logFile.canWrite()) {
    session.read(flowFile, { inputStream ->
        text = IOUtils.toString(inputStream, StandardCharsets.UTF_8)
        logFile.append(text)
        logFile.append(recordSeparator)
    } as InputStreamCallback)
    session.transfer(flowFile, REL_SUCCESS)
} else if (logFile.exists() && !logFile.canWrite()) {
    log.error('Cannot write to log file' + logPath)
    session.transfer(flowFile, REL_FAILURE)
} else if (!logFile.exists()) {
    File newLogFile = new File(logPath)
    session.read(flowFile, { inputStream ->
        text = IOUtils.toString(inputStream, StandardCharsets.UTF_8)
        newLogFile.write(text)
        newLogFile.append(recordSeparator)
    } as InputStreamCallback)
    session.transfer(flowFile, REL_SUCCESS)
} else {
    log.error('Some Error in writing into log file')
    session.transfer(flowFile, REL_FAILURE)
}
